import React from "react";
import { Link } from "react-router-dom";
import { NavWrapper, NavContents } from "./NavStyles";
import styled from "styled-components";

const StyledLink = styled(Link)`
color: "hotpink";
text-decoration: "none";
text-align: "center";
:hover {
    color: white;
    background-color: black;
  },
`;

const Nav = () => {
  return (
    <NavWrapper>
      <NavContents>
        <Link
          to={"/"}
          style={{
            color: "hotpink",
            textDecoration: "none",
            textAlign: "center",
          }}
        >
          {" "}
          Home{" "}
        </Link>

        <StyledLink
          to={"/interview"}

        >
          {" "}
          Interview{" "}
        </StyledLink>

        <Link
          to={"/projects"}
          style={{
            color: "hotpink",
            textDecoration: "none",
            textAlign: "center",
          }}
        >
          {" "}
          Projects{" "}
        </Link>

        <Link
          to={"/contact"}
          style={{
            color: "hotpink",
            textDecoration: "none",
            textAlign: "center",
          }}
        >
          {" "}
          Contact{" "}
        </Link>

        <header>
          <p>Nav</p>
        </header>
      </NavContents>
    </NavWrapper>
  );
};

export default Nav;
